(146, 197, '11/12/2017', 'Dr Joan Chin', '1.dizzy 1 year, with vertigo, no tinnitus or deafness, no limb weakness or numbness, vertigo worse on turning the head\r\n2.feeling \'hot \' in abdomen 1 year,, novomiting, no diarrhoea, has constipation, bo only once a week, hard stools\r\n3.bilateral knee painx 1 year,no swelling\r\no/e: not pale,no jaundice, no nystagmus, cranial nerve intact, no pronator drift. moves all 4 limbs well, rhomberg neg, tandem gait normal\r\nboth knees no effusion. left knee: crepitus ++, r  knee mild crepitus', 'bppv\r\nOA knee Left > R\r\nconstipation', '', '', '', '', '', 0),
(147, 195, '11/12/2017', 'Dr Benjamin Tang', 'epigastric pain. burning\r\nreflux 3-4 years. occurs everyday\r\nworse in morning but continues throughout the day\r\nAssoc LUQ pain after meals\r\nmostly watery and undigested stools. diarrhoea 4X in a day. yellow. not white\r\n\r\nSOBOE.  400m on walking\r\noccurs on stairs\r\n4 years and getting worse\r\n\r\nAbdo Soft. mild tenderness sin epigastric region and left lower diaphragm\r\nchest clear\r\nno pleuritic pain', 'Reflux disease\r\n\r\nProgress:\r\nadvised for smaller meals, lose weight, not to lie down after eating, drink water in between meals', '', '', '', '', 'advised to see cardiologist for stress testing +/- echo as outpatient', 0),
(148, 199, '11/12/2017', 'Admin', 'Headache x 2 months\r\nKnown Hypertension x 2 yrs\r\non med from pharmacy\r\nChest pain 4 days after work at factory\r\nassoc with exercise and dyspnea\r\n\r\n', 'Hypertension\r\n?Angina', 'Cardiovascular', '', '', '', 'Chest pain x 4 days associated with exercise and mild breathlessness\r\n Known Hypertension  x 2 years on medication but defaulted\r\nLatest BP 180/110\r\nHas started her on  Atenolol 50mg', 0),
(149, 196, '11/12/2017', 'Dr Regina Tan', 'Large Goitre X 17 years\r\ntaking methimazole 5mg bd \r\nhas been on medication for 17 years\r\n has palpitations, fatigue, LOW \r\n Pulse 104/min, sweaty palms tremors of hands+\r\nHuge goitre wit bruit++', 'Hyperthyroidism with  large goitre\r\nAdvised to increase Methimazole to 10mg bd', '', '', '', '', 'referral to General Surgery for thyroidectomy', 0),
(150, 200, '11/12/2017', 'Dr Anu Pandey', 'Almost 9 months old\r\nBW 2.4kg \r\nCW 8kg (25-50%)\r\n\r\n1. Fever \r\n- on and off for the past 3 months\r\n- has visited the clinic multiple times\r\n- sometimes associated with URTI symptoms\r\n- currently no associated symptoms\r\n- no contact with pTB patients\r\n- no sick contacts \r\n\r\nPast 2 weeks stools more loose (yellow stools, no blood)\r\nPU - no smelly urine, no discharge \r\n\r\nNo LOA/LOW (parents concerned about poor weight gain  but current weight on appropriate centiles)\r\n\r\nSystemic examination unremarkable\r\nNo joint swelling \r\nNo cardiac murmur\r\nNo lymphadenopathy\r\nNo hepatosplenomegaly\r\nNo rashes or skin changes\r\n\r\n\r\n', '1. Pyrexia of unknown origin ', '', '', '', '', 'Pediatric Medicine ', 0),
(151, 185, '11/12/2017', 'Dr Angeline Lim', 'Vaginal discharge x 1 to 2 years assciated with pruritis vulva\r\nNo dysuria\r\nNo abdo pain\r\nRefuse exami\r\nDiagnosis: Vaginitis', 'Vaginitis', 'Gynaecology', '', '', '', '', 0);
