(18, 103, 'Mon Dec 11 13:19:28 ICT 2017', 'Dr Deborah Lee', 'Above hx corroborated:\r\n73yo F usually fit and well, presenting with fever (38.1 -> 38.5 on repeat)\r\n\r\nBackground:\r\ni. Farmer; lives with family (5 people at home), no one else has similar sx\r\nii. Non-smoker \r\niii. Took ?unknown \"medication for lungs\" over 6/12 last year - from hospital\r\niv. No personal or FHx of PTB\r\nv. Gastritis - On PPI PRN\r\nvi. Allergies - Nil\r\n\r\nIssues:\r\n1) Chronic cough\r\n- 3/12 of ongoing dry cough (no haemoptysis) + LOW (3kg in 2.12) + intermittent fevers/ chills + fatigue\r\n- Similar symptoms ?5 years ago\r\n- No night sweats; no occult symptoms\r\n\r\nO/E:\r\nCute elderly lady, appears fit for her age\r\nTemp taken during consult 38.5c\r\n- Nil lymphadenopathy\r\n- CVS -> HS I + II + tachycardia, regular\r\n- Respi -> Left basal to mid zone crepitus + reduced AE\r\n- Mild clubbing\r\n\r\nImp:\r\nChest infection\r\n?PTB\r\n\r\nPlan:\r\n1. CXR, then to decide on modality of treament\r\n2. Sputum MCS if available'),
